import axios from "axios";
import { GET_VISIONS, DELETE_VISIONS } from "./types";

//get visions
export const getVisions = () => dispatch => {
  axios
    .get("http://127.0.0.1:8000/api/vision/")
    .then(res => {
      dispatch({
        type: GET_VISIONS,
        payload: res.data
      });
    })
    .catch(err => console.log(err));
};
//delete vision
export const deleteVisions = id => dispatch => {
  axios
    .get("http://127.0.0.1:8000/api/vision/")
    .then(res => {
      dispatch({
        type: DELETE_VISIONS,
        payload: id
      });
    })
    .catch(err => console.log(err));
};
